  {
  firstname: 'Olive',
  lastname: 'Yew',
  email: 'olive@test.com',
  carmodel: 'Honda Gt',
  phoneno: '9800000000',
  },
  {
    firstname: 'Maureen',
    lastname: 'Biologist',
    email: 'maureen@g.com',
    carmodel: 'Nissan',
    phoneno: '9800000001',
    }
]



